* YOU WILL FIND ST. MARY'S CATH./HOLY NAME OF MARY CEM. ON THE TOWN OF FORESTVILLE MAPS PAGE *

Location: NE Corner NE1/4 NW1/4 Section 9, Town of Forestville. 0.8 miles east of Maplewood off of Highway 42 on County Trunk H on the south side of the road. The name of the church was changed from St. Mary Catholic Church to Holy Name of Mary Church in 1884 when new church was built in Maplewood. The monument with the cemetery name is still St. Mary and was donated in memory of Mr. & Mrs. Edward Schmelzer, Syl & Mary Schmelzer , Clayton & Doloris Junion. The cemetery is located next to the church and maintained in good condition by parish members.

Indexed by Beverly Diefenbach of the W.S.O.C.S. on November 20, 1976.

Re-indexed October 2 & 9, 2000 by Susan Havel of the PGS.

