HANSEN, Mead R.*/b. 3 Nov 1927, Manitowoc, WI-d. Sat. 5 Mar 2011, Golden Living Center, Sturgeon Bay, Door Co., WI; *Source: OBITUARY-HUEHNS Funeral Home: Mead R. HANSEN, 83, of Sturgeon Bay, Wisconsin, passed away with his family at his side, on Saturday, March 5, 2011 at Golden Living Center in Sturgeon Bay-born on 3 Nov 1927 in Manitowoc, Wisconsin, the only child of Mead F. and Evelyn (WOERFEL) HANSEN-graduated from Manitowoc Lincoln High School in 1945-veteran of World War II, serving with the U. S. Army Signal Corps-married on 14 Sep 1948 to high school sweetheart Monica Leona MARESCH in Manitowoc-dedicated his life to education-after receiving his teaching certificate from the Manitowoc County Normal School began teaching career at Pine River County School, a one-room schoolhouse in Manitowoc County-completed a Bachelors degree in Education at UW-Oshkosh-In 1954, moved to Hartford, Wisconsin where he was a building principal and teacher at Washington Grade School and a science teacher at Hartford Middle School-After completing his Master's Degree in Supervision and Curriculum Coordination from UW-Milwaukee in 1967 took a position as Curriculum Coordinator for the Kewaunee School District-helped establish a middle school and set up the pre-school special education program there-In 1973 became Elementary Principal for the Gibraltar School District in Fish Creek-was involved in starting the first learning disabilities program in Door County and was acting Superintendent-became Elementary Principal for the Southern Door School District in 1976-later selected as District Superintendent until his retirement in 1988- After retirement returned to educational administration on two occasions, serving as Principal at Sunrise Elementary and Corpus Christi Elementary schools in Sturgeon Bay-helped organize the Wisconsin Association for Supervision and Curriculum Development and was Executive Director for ten years-also worked for CESA-7 and helped teacher candidates at UW-Green Bay-served on the Board of Directors for the Door County Hospital Foundation and the United Way-Mead was a member of the Forestville-Maplewood Lions and AMVETS-survived by his wife of 62 years, Monica, his 6 children and their spouses, William HANSEN and Diane GORYCHKA of Manitowoc, Linda HANSEN and Dave NICKELS of Two Rivers, Jennifer and Roger LEVENDUSKY of Sturgeon Bay, Paul and Kathy HANSEN of Arlington, Virginia, Martha and Eric GENAME of Ellison Bay, Sarah and Doug SCHOENWALDER of Green Bay, and six granddaughters, Margaret HANSEN, Emily HANSEN and boyfriend Kevin KRALIK, Katherine LEVENDUSKY, Elizabeth LEVENDUSKY, Stacy SCHOENWALDER, and Rebecca SCHEOENWALDER-also survived by his sisters-in-law Jeanne KLEIN, Sister Paulus MARESCH, and Phyllis (Louis) MCKEE of Manitowoc, and his brother-in-law Charles (Mary) KOMOSA of Waupun-preceded in death by his parents and sister-in-law Elizabeth (MARESCH) KOMOSA of Waupun-Mass of Christian Burial celebrated Friday 11 Mar 2011 at St. Joseph Catholic Church with Fr. Robert KONKOL as celebrant-Burial will be at Holy Name of Mary Catholic Cemetery in Maplewood-Military honors will be provided at St. Joseph Catholic Church following the Mass- Huehns Funeral Home in Sturgeon Bay www.huehnsfuneralhome/com

