SCHMELZLE, Helen/8 Jun 1917-(6 Mar 2011*), ossw Floyd (Lloyd*) SCHMELZLE;*Source: OBITUARY-FORBES Funeral Home: SCHMELZLE, Helen Ann (ZETTEL)*/b. 8 Jun 1917, Sturgeon Bay, Door Co., WI-d. 6 Mar 2011; *Source: OBITUARY-FORBES Funeral Home: Helen Ann (ZETTEL) SCHMELZLE, (93), of Forestville-wife of Lloyd SCHMELZLE-Parents: Anton and Frances (FAKEN) ZETTEL-after high school graduated from the Door Kewaunee Normal School and the Milwaukee Teachers College-nine and a half years in the Door County Schools of Stokes, Vignes, and East Maplewood, and thirteen years at St. Marys Catholic School in Algoma-loved music and also taught piano lessons in her home for many years-married Lloyd SCHMELZLE in Maplewood on 28 Oct 1943-He preceded her in death on 16 Sep 1999-Helen and Lloyd were very caring parents to daughter Frances and her husband Jim BIRSCHBACH, and doting grandparents to Jason and Michael-great-grandson, Colin Birschbach and continued to pray for her grandson not yet born-4-H member and leader, C.Y.O. youth member and leader, a Forestville Library volunteer, Door County Civil Defense member, active in the Senior Citizen Club and the Catholic Knights-active parishioner of Holy Name of Mary Church, in Maplewood-member and past president of the Altar Society, served on the Board of Education, sang in the choir, and was an active mission volunteer-Survivors include her daughter, Fran (Jim) BIRSCHBACH, Menomonee Falls; 2 grandchildren, Michael BIRSCHBACH, Sun Prarie, and Jason (Nicole) BIRSCHBACH, Menomonee Falls; 1 great-grandson, Colin BIRSCHBACH and 1 great-grandson "on the way"; 2 sisters, Theresa (John-deceased) WORACHEK, Reedsville, and Mary Ann (GROOMER) DAVIS, Hartland, 2 brothers, Marcus (Eunice BRETL-deceased) ZETTEL, Clifton, VA, and Ralph (Mary) ZETTEL, Maplewood; sister-in-law, Doris (Stanton-deceased) SOUKUP, Algoma; many nieces, nephews, relatives and friends-preceded in death by her beloved parents, her husband, and two infant brothers-Funeral services Wednesday, March 23, 2011 at Holy Name of Mary Church in Maplewood-Burial will be in the church cemetery- The funeral service for Helen has been postponed (due to snowstorm) until Thursday, March 24, at the same times-FORBES Funeral Home

